import React from "react";
import styled from "styled-components";
import IntroSection from "../sections/IntroSection";

const Nav = styled.section`
  width: 100vw;
  height: 5vh;

  display: flex;
  justify-content: flex-end;
  align-items: center;
`;

const Text = styled.a`
  max-width: 37rem;
  color: white;
  margin-left: 15px;

  a {
    color: white;
    text-decoration: none;
    margin-right: 20px;
  }
`;

 const Navbar = () => {
  return (
    <Nav>
      <Text>
        <li>
          <a href="/about">About</a>
        </li>
      </Text>
    </Nav>
  );
};
